---@class FImportAssetParameters
---@field public ReimportAsset UObject @If the import is a reimport for a specific asset set the asset to reimport here
---@field public ReimportSourceIndex integer @If we are doing a reimport, set the source index here. Some asset have more then one source file when they import partial part of there content.
---@field public bIsAutomated boolean @Tell interchange that import is automated and it shouldn't present a model window
---@field public bFollowRedirectors boolean @Tell interchange to follow redirectors when determining the location an asset will be imported
---@field public OverridePipelines TArray<FSoftObjectPath> @Adding some override will tell interchange to use the specific custom set pipelines instead of letting the user or the system chose
---@field public OnAssetDone Delegate @Delegates used track the imported objects // This is called each time an asset is imported or reimported from the import call
---@field public OnAssetsImportDone Delegate @This is called when all the assets where imported from the source data
---@field public OnSceneObjectDone Delegate @This is called each time an object in the scene is imported or reimported from the import call
---@field public OnSceneImportDone Delegate @This is called when all the scene object where imported from the source data
local FImportAssetParameters = {}
